ion to the leak your transmission is not working well and you notice changes in the way it sounds when you shift gears, or if shifting gears is not working as well. In this case you likely have a leak of transmission fluid that is impacting how your transmission operates.\"}]', 2, '500.00', '271.00', 1, NULL, NULL, NULL, 7, 'Auto', 5, 4, 'draft', 1, 1, NULL, '2020-07-27 15:58:35', '2020-03-16 05:48:44', '2020-07-27 15:58:35', '4.0'),
