 can be. Often times the symptoms you\\u2019ll experience from low or dirty transmission fluid will be the same as transmission problems. If you check the fluid levels regularly and refill as necessary then you\\u2019ll know if there are any symptoms of trouble that it\\u2019s not because the fluid levels are low and you need to see a mechanic.\"},{\"title\":\"Are there different types of transmission fluid?\",\"content\":\"How do I know what to buy? Yes, there are many different types of transmission fluid, each designed for a certain transmission. Different vehicles require different transmission fluids and the age of the car can also be a factor because newer transmissions take different types of transmission fluids than older vehicles. Don\\u2019t guess! Find out which type of transmission fluid is required for your vehicle by checking your owner\\u2019s manual.\"},{\"title\":\"What is a transmission flush and should I get one?\",\"content\":\"A transmission flush is used by some auto repair shops with the goal of flushing out debris.  Auto Tech does not do any sort of transmission flush.  Flushing an older transmission can cause harmful sediment to get stuck in the solenoids of the transmission. We heavily favor regular maintenance to lengthen the life of your transmission.  We service the transmission by changing fluid and the filter and do not recommend having your transmission flushed.\"},{\"title\":\"How do I know I have a fluid leak from the transmission?\",\"content\":\"Transmission fluid is slightly pink in color \\u2013 it will appear pink or red, or possibly more brownish if the transmission fluid is dirty and needs to be replaced. When you feel transmission fluid it will be slick and oily on your fingers. It smells much like oil unless it is dirty, in which case it will smell burnt. Usually transmission fluid leaks around the front or middle of your vehicle, so if you find puddles of reddish liquid there it is probably transmission fluid. Another clue is if in addition to the leak your transmission is not working well and you notice changes in the way it sounds when you shift gears, or if shifting gears is not working as well. In this case you likely have a leak of transmission fluid that is impacting how your transmission operates.\"}]', 5, '400.00', '0.00', 0, NULL, NULL, NULL, 9, 'Auto', 3, 4, 'draft', 1, 5, 1, '2020-07-27 15:58:35', '2020-03-16 05:48:44', '2020-07-27 15:58:35', '0.0'),
(14, 'Sepeda Gunung', 'sepeda-gunung', '<h3 style=\"margin: 10px 0px; position: relative; line-height: 31px; font-size: 28px; text-transform: capitalize; width: 850px; letter-spacing: -0.5px; color: #6b6864; font-family: Lato, sans-serif; background-color: #ffffff;\">Jenis Sepeda Yang Digunakan</h3>\r\n<p><span style=\"color: #6b6864; font-family: Lato, sans-serif; font-size: 16px; background-color: #ffffff;\">Satu lagi keunikannya, hampir semua sepeda yang disewakan di Pulau Tidung jenis nya sama. Makanya kita musti benar-benar menghapal sepeda yang kita gunakan. Selain berjenis sama, tidak sedikit sepeda-sepeda yang ada, punya warna yang seragam. Anggap sepeda yang kita pakai adalah kendaraan pribadi kita selama berada di Pulau Tidung, hapal warnanya, tulisan nya, serta tanda-tanda yang ada supaya tidak tertukar dengan sepeda lain.</span></p>', 187, 189, 9, 'Bar.,Pulau Tidung, Kepulauan Seribu Sel., Pulau Tidung, Kepulauan Seribu Sel., Kabupaten Kepulauan Seribu, Daerah Khusus Ibukota Jakarta 145200853-1135-9467', NULL, NULL, 8, NULL, NULL, NULL, NULL, 4, '30000.00', '20000.00', NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, 'publish', 1, 1, 1, NULL, '2020-03-17 22:39:52', '2020-07-30 10:37:48', NULL),
