 made 72 hours prior to your arrival date, no fee will be charged.\\r\\n- If cancellation\\/amendment is made within 72 hours, including reservations made within 72 hours of your arrival, 1st night\\u2019s room rate and tax will be charged\\r\\n- In case of no-show, 100% room rate and tax will be charged.\\r\\n- Early Bird\\/Long Stay\\/Last Min\\/Package Rates are Non - changeable & Non - refundable\"},{\"title\":\"Late check-out policy\",\"content\":\"- Late check-out is subject to room availability\\r\\n- 12:00 to 17:00 check-out: 50% room rate surcharge\\r\\n- After 17:00 check-out: 100% room rate surcharge\"}]', 5, '550.00', '12:00AM', '11:00AM', NULL, NULL, 'publish', 5, NULL, '2020-07-27 15:57:09', '2020-03-16 05:48:43', '2020-07-27 15:57:09', '4.3', NULL),
(11, 'PENGINAPAN PULAU TIDUNG', 'penginapan-pulau-tidung', '<p style=\"margin: 0px 0px 15px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 13px; line-height: inherit; font-family: Roboto, Arial, Tahoma, sans-serif; vertical-align: baseline; color: #626262; background-color: #ffffff;\">Pulau Tidung menawarkan sejumlah destinasi wisata yang membuatnya menjadi salah satu primadona di Kepulauan Seribu. Pulau ini cocok untuk semua kalangan &ndash; tua, muda, dan bahkan anak-anak. Selain itu, banyak aktivitas menarik yang dapat dilakukan, sehingga wisatawan tidak akan pernah merasa bosan, antara lain:</p>\r\n<ul style=\"margin: 0px 0px 0px 30px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 13px; line-height: inherit; font-family: Roboto, Arial, Tahoma, sans-serif; vertical-align: baseline; list-style-position: outside; list-style-image: initial; color: #737e86; background-color: #ffffff;\">\r\n<li style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">Wisata Air, seperti snorkeling, berenang, jet ski, memancing, atau bermain di pantai, seperti main volley pantai atau main bola. Pulau ini adalah destinasi yang ideal untuk relaksasi, dan melepaskan diri dari kepenatan setelah mengalami masa-masa penuh stress di tempat kerja.</li>\r\n<li style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">Ya, berkunjung ke Pulau Tidung bersama pasangan tidak sempurna sebelum menikmati suasana romantis di Jembatan Cinta, yang menghubungkan Pulau Tidung Besar dan Pulau Tidung Kecil. Saat paling sempurna untuk menikmati pemandangan di sini adalah saat mata hari terbenam alias sunset. Anda dan pasangan juga bisa menantang adrenalin dengan melompat dari Jembatan Cinta.</li>\r\n<li style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">Pantai yang indah. Pulau Tidung memiliki sejumlah pantai perawan dengan pemandangan yang menakjubkan, seperti Pantai Cemara Kasih dan Pantai Saung Perawan. Dari namanya saja, anda bisa membayangkan suasananya, bukan?</li>\r\n<li style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">Melihat penangkaran penyu sisik dan penangkaran hiu</li>\r\n<li style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">Bersepeda santai, sambil melihat-lihat pemukiman penduduk setempat</li>\r\n<li style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">memancing</li>\r\n<li style=\"margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">Mengunjungi pulau-pulau sekitar</li>\r\n</ul>', 67, 176, NULL, 'Bar.,Pulau Tidung, Kepulauan Seribu Sel., Pulau Tidung, Kepulauan Seribu Sel., Kabupaten Kepulauan Seribu, Daerah Khusus Ibukota Jakarta 145200853-1135-9467', '-5.79859278', '106.49817646', 14, 1, '174,173,', 'https://www.youtube.com/watch?v=bhOiLfkChPo', NULL, 4, '550000.00', '12:00AM', '11:00AM', NULL, NULL, 'publish', 2, 1, NULL, '2020-03-16 05:48:43', '2020-08-07 17:53:01', '4.6', NULL);
