(1, 'Pulau Pari', '<p style=\"box-sizing: border-box; margin: 0px 0px 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; text-align: justify; color: #404040; background-color: #ffffff;\"><strong style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pulau Pari</strong>&nbsp;merupakan Wilayah&nbsp;<strong style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kepulauan Seribu</strong> yang terdapat Penduduk di pulau tersebut, pulau yang jarak tempuhnya kurang lebih 90 menit dari Marina Ancol Jakarta. Pulau penduduk diantaranya&nbsp;<em style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pulau Pramuka, Pulau Tidung, Pulau Harapan</em>. Pulau&ndash;pulau tersebut semuanya berpenghuni dan membangun tempat tinggal di pulau tersebut. Wisata Pulau Penduduk semuanya di kelola oleh sekitaran orang penduduk setempat.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; text-align: justify; color: #404040; background-color: #ffffff;\">Asal mula&nbsp;<em style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pulau Pari</em>&nbsp;adalah sebuah pulau kosong yang tidak berpenghuni. Lalu pada jaman belanda banyak penduduk tanggerang lari ke&nbsp;<strong style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pulau Seribu</strong>&nbsp;yaitu untuk menghindari kerja paksa. Dinamakan pulau tersebut karena perairan yang dangkal dan banyaknya ikan pari, maka dinamilah pulau pari.</p>', 'paris', 168, '-5.7968049', '106.4250838', 10, 'publish', 1, 2, NULL, 1, 1, NULL, NULL, NULL, '2020-03-16 05:48:42', '2020-03-17 10:52:44', 169, '[{\"image_id\":\"112\",\"title\":\"Experiencing the best jazz in Harlem, birthplace of bebop\",\"link\":\"#\",\"content\":\"New Orleans might be the home of jazz, but New York City is where many of the genre\\u2019s greats became stars \\u2013 and Harlem was at the heart of it.The neighborhood experienced a rebirth during the...\"},{\"image_id\":\"113\",\"title\":\"Reflections from the road: transformative \\u2018Big Trip\\u2019 experiences\",\"link\":\"#\",\"content\":\"Whether it\\u2019s a gap year after finishing school, a well-earned sabbatical from work or an overseas adventure in celebration of your retirement, a big trip is a rite of passage for every traveller, with myriad life lessons to be ...\"}]'),
(2, 'Pulau Tidung', '<p style=\"box-sizing: border-box; margin: 0px 0px 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; text-align: justify; color: #404040; background-color: #ffffff;\"><strong style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pulau Tidung</strong>&nbsp;merupakan bagian dari gugusan&nbsp;<strong style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kepulauan Seribu</strong>, Pulau Tidung Pulau terbesar dari pulau-pulau seribu lainnya. Pulau ini masuk dalam bagian pulau penduduk.&nbsp;<em style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pulau tidung membujujur panjang dari barat ke timur sehingga terbagi menjadi 2 bagian yaitu pulau tidung besar dan pulau tidung kecil</em>. Yang biasa di kunjungi oleh wisatawan adalah pulau tidung besar.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; text-align: justify; color: #404040; background-color: #ffffff;\">Kedua pulau ini hanya dihubungkan dengan jembatan panjang yang dinamakan&nbsp;<strong style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Jembatan Cinta</strong>. Jembatan cinta merupakan icon atau tempat wisata di pulau ini. Banyak wisatawan yang berkunjung Ke jembatan Pulau tersebut, karena Pulau tidung terkenal dengan jembatannya. Sering sekali wisatawan meloncat dari jembatan cinta untuk merasakan keberanian nyali mereka meloncat dari&nbsp;<em style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">jembatan cinta</em>.</p>', 'new-york-united-states', 167, '-5.8139748', '106.2859102', 13, 'draft', 3, 4, NULL, 1, 1, '2020-07-30 09:27:45', NULL, NULL, '2020-03-16 05:48:42', '2020-07-30 09:27:45', 171, NULL),
(3, 'Pulau Pramuka', '<p style=\"box-sizing: border-box; margin: 0px 0px 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; text-align: justify; color: #404040; background-color: #ffffff;\"><em style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pulau Pramuka</em>&nbsp;merupakan kepulauan Penduduk yang terletak 90 menit dari marina ancol. Wisata pulau penduduk selain di pulau iniyang ada dikawasan&nbsp;&nbsp;<a style=\"box-sizing: border-box; background: 0px 0px; color: #e96656; text-decoration-line: none; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; transition: all 700ms ease 0s;\" href=\"http://kepulauan-seribu.com/\" target=\"_blank\" rel=\"noopener\">Pulau Seribu</a>, diantaranya pulau pari, pulau tidung, pulau harapan.&nbsp;<a style=\"box-sizing: border-box; background: 0px 0px; color: #e96656; text-decoration-line: none; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; transition: all 700ms ease 0s;\" href=\"http://kepulauan-seribu.com/objek-wisata-pulau-pramuka.html\" target=\"_blank\" rel=\"noopener\">Pulau Pramuka&nbsp;</a>merupakan pusat administrasi dan pemerintahan Kabupaten Administratif&nbsp;<strong style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kepulauan Seribu</strong>.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; text-align: justify; color: #404040; background-color: #ffffff;\">Fasilitas yang dimiliki diantaranya :</p>\r\n<ul style=\"box-sizing: border-box; margin: 0px 0px 1.5em 3em; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; vertical-align: baseline; list-style-position: initial; list-style-image: initial; color: #404040; background-color: #ffffff; padding: 0px 0px 0px 0px !important;\">\r\n<li style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Tersedia Sekolah baik mulai Sekolah dasar sampai Sekolah menengah</li>\r\n<li style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Rumah Sakit</li>\r\n<li style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Tempat Pelelangan Ikan</li>\r\n<li style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Terdapat Villa dan Home Stay untuk para wisatawan beristirahat.</li>\r\n</ul>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; text-align: justify; color: #404040; background-color: #ffffff;\">Tempat istirahat menginap Type Villa terdapat di tepi pantai / sea view. Banyak para wisatawan yang berminat menginap di type Villa.&nbsp;<em style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pulau Pramuka</em>&nbsp;mempunyai pantai yang tidak kalah menarik dengan&nbsp;<em style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">pulau pari</em>&nbsp;dan&nbsp;<em style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">pulau tidung</em>, aktifitas&nbsp;<em style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">snorkeling</em>&nbsp;juga merupakan aktifitas favorite para tamu wisatawan.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; text-align: justify; color: #404040; background-color: #ffffff;\">Di sini kita juga dapat melihat penangkaran&nbsp;<em style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">penyu sisik</em>, karena hewan langkah ini sudah hampir punah, oleh karenanya dilestarikan dan dilindungi.&nbsp;<a style=\"box-sizing: border-box; background: 0px 0px; color: #e96656; text-decoration-line: none; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; transition: all 700ms ease 0s;\" href=\"http://kepulauan-seribu.com/\" target=\"_blank\" rel=\"noopener\">Pulau Pramuka</a>&nbsp;dapat dikatakan sebagai pulau konservasi. Terdapat pula&nbsp;<em style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Penanaman Bakau</em>, sebagi usaha untuk pencegahan Abrasi, sehingga wisata yang ada di pulau ini dapat dikatakan sebagai wisata alam laut dan daratan.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; text-align: justify; color: #404040; background-color: #ffffff;\">Selain harga yang tidak terlalu mahal di sini juga merupakan tempat wistawan yang cukup menarik pengunjung. Kami menyediakan beberapa&nbsp;<a style=\"box-sizing: border-box; background: 0px 0px; color: #e96656; text-decoration-line: none; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; transition: all 700ms ease 0s;\" href=\"http://kepulauan-seribu.com/pulau-pramuka\">paket pulau pramuka</a>&nbsp;dengan harga ekonomis, baik melalui&nbsp;<em style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Marina Ancol</em>&nbsp;maupun dari&nbsp;<em style=\"box-sizing: border-box; border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Muara Angke</em>.</p>', 'california', 172, '-5.7456185', '106.6094047', 12, 'publish', 5, 6, NULL, 1, 1, NULL, NULL, NULL, '2020-03-16 05:48:42', '2020-03-17 11:00:06', 170, NULL),
