(42, 'user_content_email_registered', 'user', '<h1 style=\"text-align: center;\">Welcome!</h1>\r\n<h3>Hello [first_name] [last_name]</h3>\r\n<div id=\"tw-target-text-container\" class=\"tw-ta-container hide-focus-ring tw-nfl\" tabindex=\"0\">\r\n<pre id=\"tw-target-text\" class=\"tw-data-text tw-text-large XcVN5d tw-ta\" dir=\"ltr\" style=\"text-align: left;\" data-placeholder=\"Terjemahan\"><span lang=\"id\">Terima kasih telah mendaftar di website appulau.xyz! Kami harap Anda menikmati waktu Anda bersama kami.</span></pre>\r\n</div>\r\n<div id=\"tw-target-rmn-container\" class=\"tw-ta-container hide-focus-ring tw-nfl\">\r\n<pre id=\"tw-target-rmn\" class=\"tw-data-placeholder tw-text-small tw-ta\" dir=\"ltr\" style=\"text-align: left;\" data-placeholder=\"\">silahkan login di https://appulau.xyz/id/login</pre>\r\n</div>\r\n<p>Regards,</p>\r\n<p>Appulau.xyz</p>', NULL, 1, 1, NULL, NULL, '2020-07-27 09:53:05'),
