(45, 'user_content_email_forget_password', 'user', '<h1>Hello!</h1>\r\n<p>You are receiving this email because we received a password reset request for your account.</p>\r\n<p style=\"text-align: center;\">[button_reset_password]</p>\r\n<p>This password reset link expire in 60 minutes.</p>\r\n<p>If you did not request a password reset, no further action is required.</p>\r\n<p>Regards,</p>\r\n<p>Appulau</p>', NULL, 1, 1, NULL, NULL, '2020-07-27 09:25:22'),
